pragma solidity 0.6.4;
pragma experimental ABIEncoderV2;

import "./AbstractFactory.sol";

import "./policy/PolicyModel.sol";

import "./Policy.sol";

contract PolicyFactory is 
    AbstractFactory, 
    PolicyModel
{
    struct PolicyInstance {
        address instanceAddress;
        address instanceAddressOwner;
    }

    mapping(uint256 => PolicyInstance) private _policiesInstance;
    uint256 private _policyInstanceId; 

    mapping(address => PolicyInstance[]) private _multuaPoliciesInstance;

    event PolicyGenerated(
        address instancecAddress
    );

    function generatePolicy(
        PolicyModelStruct memory policyModel
    ) public
        whenNotPaused
        onlyMutual
    {
        Policy instance = new Policy(
            policyModel
        );

        address instanceAddress = address(instance);
        _policyInstanceId++;
        _policiesInstance[_policyInstanceId] = PolicyInstance(
            instanceAddress,
            msg.sender
        );

        for(uint i = 0; i < policyModel.mutual.wallets.length; i++){
            _multuaPoliciesInstance[policyModel.mutual.wallets[i]].push(_policiesInstance[_policyInstanceId]);
        }

        emit PolicyGenerated(instanceAddress);
    }

    function consultMutualPolicies(
        address multualAddress
    ) public 
      view
      returns (address[] memory policyAddress, address[] memory ownerAddress)
    {
        PolicyInstance[] memory policyInstance = _multuaPoliciesInstance[multualAddress];
        PolicyInstance[] memory policyInstanceMultua = _multuaPoliciesInstance[msg.sender];

        require(policyInstanceMultua.length > 0 || isAdmin(msg.sender), 'PolicyFactory: must be multual or Admin');

        address[] memory instanceAddresses = new address[](policyInstance.length);
        address[] memory ownerAddresses = new address[](policyInstance.length);

        for(uint256 i = 0; i < policyInstance.length; i++){
            instanceAddresses[i] = policyInstance[i].instanceAddress;
            ownerAddresses[i] = policyInstance[i].instanceAddressOwner;
        }

        return (instanceAddresses, ownerAddresses);
    }

}
